(5253, '_transient_ccss_explain_ao26', '<h2>Improve first paint times by removing render-blocking CSS</h2>\n<div style=\"width:100%;overflow:hidden\">\n<div style=\"width:68%;float:left\">\n  <p>Is Google Pagespeed Insights complaining about <strong>render-blocking CSS</strong>? Are your <strong>first paint times</strong> sub-optimal because of that render-blocking CSS?</p>\n  <p><strong>Above the fold CSS</strong> (as part of Autoptimize\'s \"Inline &amp; defer CSS\") can help you improve, but <strong>most sites need different critical CSS for different types of pages/ posts</strong> and generating the correct above the fold CSS can be difficult!</p>\n  <p>That is where the \"<a href=\"https://wordpress.org/plugins/autoptimize-criticalcss/\" target=\"_blank\">Autoptimize Critical CSS Power-Up</a>\" can help; you install it, add a <a href=\"https://criticalcss.com/?aff=1\" target=\"_blank\">criticalcss.com</a> API key (paying subscription required) and the <strong>power-up will automatically create rules with criticalcss.com generated critical CSS</strong>. Moreover you can tweak rules, add manual rules, force inclusion of specific selectors, ...</p>\n<p style=\"margin:30px 0px\"><a class=\"button\" href=\"./plugin-install.php?s=autoptimize+criticalcss&amp;tab=search&amp;type=term\">Click here to install the Power-Up</a></p>\n</div>\n<div style=\"width:28%;float:right\"><img src=\"https://criticalcss.com/images/criticalcss-optimised-website-illustration.svg\" width=\"350px\"></div>\n</div>\n', 'no'),
