ng span::before {\\n\\tcolor: #ffa500;\\n}\\n/*** CHANGE PRICE SIZE ON GRID AND RELATED PRODUCTS ***/\\n.woocommerce ul.products li.product .price, \\n.woocommerce ul.products li.product .price del, \\n.woocommerce-page ul.products li.product .price, \\n.woocommerce-page ul.products li.product .price del {\\n\\tfont-size: 18px;\\n}\\n/*** CENTER SALE BADGE AND CHANGE COLORS ***/\\n.woocommerce span.onsale, \\n.woocommerce-page span.onsale {\\n\\tbackground: #FFA500;\\n\\tcolor: #fff;\\n\\tletter-spacing: 2px;\\n\\tleft: 50%;\\n\\ttransform: translate(-50%, -50%);\\n\\t-ms-transform: translate(-50%, -50%);\\n}\\n/*** GET RID OF BLACK LINE UNDER IMAGE ***/\\n.woocommerce ul.products li.product img {\\n\\tborder: 3px solid #fff; /* adds border around image and is optional */\\n\\tbox-shadow: none;\\n\\ttext-decoration: none;\\n}\\na.woocommerce-LoopProduct-link, a.woocommerce-loop-product__link,\\na.woocommerce-LoopProduct-link:hover, a.woocommerce-loop-product__link:hover,\\na.woocommerce-LoopProduct-link:focus, a.woocommerce-loop-product__link:focus {\\n\\tbox-shadow: none;\\n\\toutline: 0;\\n}\\n/*** REMOVE/CHANGE COLOR BEHIND PRICE ***/\\n.woocommerce ul.products li.product span.price ins {\\n\\tbackground: transparent; \\n}\",\n        \"type\": \"custom_css\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-02-26 11:52:52\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', '80171614-533f-4197-b4a2-de233ea677fc', '', '', '2020-02-26 11:52:56', '2020-02-26 11:52:56', '', 0, 'http://localhost/clicknbuy/?p=152', 0, 'customize_changeset', '', 0),
(153, 1, '2020-02-26 11:52:56', '2020-02-26 11:52:56', '/********************************/\n/*** WOO AND TWENTY SEVENTEEN ***/\n/********************************/\n\n/*** BREADCRUMBS ***/\n.woocommerce .woocommerce-breadcrumb {\n	font-size: 16px;\n	font-weight: bold;\n	color: #222;\n}\n/*** BREADCRUMB LINKS ***/\n.woocommerce .woocommerce-breadcrumb a {\n	color: #00707a;\n}\n/*** CHANGE COLORS ON THE FILTER DROPDOWN ***/\nselect.orderby { \ndisplay: none;\n}\n/*** SINGLE GRID ITEM STYLING ***/\n.woocommerce ul.products li.product {\n	text-align: center; /* centers titles and prices */\n	background: #f5f5f5; /* changes background color */\n	padding: 1.5em 1em; /* adds space around entire product */\n	transition: all 0.2s;\n	-moz-transition: all 0.2s; \n	-webkit-transition: all 0.2s; \n}\n.woocommerce ul.products li.product:hover {\n	background: #fff; /* changes background color on hover */\n    box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1); /* adds shadow on hover */\n	-webkit-box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1); \n	-moz-box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1);\n}\n/*** CHANGE COLOR ON SINGLE GRID AND RELATED PRODUCTS (THIS IS WHERE YOU CAN CHANGE THE FONT SIZE TOO IF YOU WANT) ***/\nh2.woocommerce-loop-product__title,\n.product .related h2 {\n	color: #000; /* change color of product titles */\n}\n/*** ADD TO CART BUTTON ***/\n.woocommerce ul.products li.product .button {\n	display: inline-block;\n	box-shadow: none;\n	background: #333;\n	color: #fff;\n	font-size: 16px;\n	padding: 8px 12px;\n	margin-bottom: 0.5em;\n	border-radius: 4px; /* makes rounded edges */\n}\n/*** CENTER STAR RATING AND MAKE STARS BIGGER ***/\n.woocommerce ul.products li.product .star-rating {\n	font-size: 18px;\n	margin-left: auto;\n	margin-right: auto;\n}\n/*** CHANGE STAR COLOR FROM THEME COLOR ***/\n.woocommerce .star-rating span::before {\n	color: #ffa500;\n}\n/*** CHANGE PRICE SIZE ON GRID AND RELATED PRODUCTS ***/\n.woocommerce ul.products li.product .price, \n.woocommerce ul.products li.product .price del, \n.woocommerce-page ul.products li.product .price, \n.woocommerce-page ul.products li.product .price del {\n	font-size: 18px;\n}\n/*** CENTER SALE BADGE AND CHANGE COLORS ***/\n.woocommerce span.onsale, \n.woocommerce-page span.onsale {\n	background: #FFA500;\n	color: #fff;\n	letter-spacing: 2px;\n	left: 50%;\n	transform: translate(-50%, -50%);\n	-ms-transform: translate(-50%, -50%);\n}\n/*** GET RID OF BLACK LINE UNDER IMAGE ***/\n.woocommerce ul.products li.product img {\n	border: 3px solid #fff; /* adds border around image and is optional */\n	box-shadow: none;\n	text-decoration: none;\n}\na.woocommerce-LoopProduct-link, a.woocommerce-loop-product__link,\na.woocommerce-LoopProduct-link:hover, a.woocommerce-loop-product__link:hover,\na.woocommerce-LoopProduct-link:focus, a.woocommerce-loop-product__link:focus {\n	box-shadow: none;\n	outline: 0;\n}\n/*** REMOVE/CHANGE COLOR BEHIND PRICE ***/\n.woocommerce ul.products li.product span.price ins {\n	background: transparent; \n}', 'Divi-child', '', 'inherit', 'closed', 'closed', '', '24-revision-v1', '', '', '2020-02-26 11:52:56', '2020-02-26 11:52:56', '', 24, 'http://localhost/clicknbuy/24-revision-v1/', 0, 'revision', '', 0),
