(355, 1, '2020-02-28 17:56:15', '2020-02-28 17:56:15', '/*\r\nTheme Name: Divi Child\r\nTheme URI: http://www.elegantthemes.com/gallery/divi/\r\nVersion: 3.22.7\r\nDescription: Smart. Flexible. Beautiful. Divi is the most powerful theme in our collection.\r\nAuthor: Tasneem Irfan\r\nAuthor URI: http://www.elegantthemes.com\r\nTags: responsive-layout, one-column, two-columns, three-columns, four-columns, left-sidebar, right-sidebar, custom-background, custom-colors, featured-images, full-width-template, post-formats, rtl-language-support, theme-options, threaded-comments, translation-ready\r\nLicense: GNU General Public License v2\r\nLicense URI: http://www.gnu.org/licenses/gpl-2.0.html\r\nTemplate: Divi\r\n*/\r\n\r\n\r\n/* body span.et_overlay {\r\n    width: 150px;\r\n    height: 50px;\r\n    background-color: #9675f7;\r\n    border-radius: 10%;\r\n    position: absolute;\r\n    top: 120%;\r\n    left: 25%;\r\n    margin: -16px 0 0 -16px;\r\n    font-size: 32px;\r\n    content: \"\";\r\n    -webkit-transition: all .4s;\r\n    -moz-transition: all .4s;\r\n    transition: all .4s;\r\n}\r\n*/\r\n\r\n/* .my-logo img.header-logo {\r\n    width: 14%;\r\n    position: absolute;\r\n    top: 20px;\r\n    left: -50px;\r\n}\r\n\r\nbody .et_pb_fullwidth_header .et_pb_fullwidth_header_container.center .header-content {\r\n    width: 40%;\r\n    max-width: 727px;\r\n    margin: 20px auto;\r\n    margin-left: 618px;\r\n}\r\nbody .my-logo{\r\n    position: absolute;\r\n    z-index: 999;\r\n    margin: 0 auto;\r\n    left: 0;\r\n    right: 0;\r\n    text-align: center;\r\n   \r\n}\r\n\r\nbody a.et_pb_button.et_pb_custom_button_icon.et_pb_more_button.et_pb_button_one{\r\n    position: absolute;\r\n    top: 10px;\r\n\r\n}\r\nbody #page-container .et_pb_fullwidth_header_0 .et_pb_button_one.et_pb_buttons {\r\n    border-radius: 25px 0px 0px 25px;\r\n}\r\nbody a.et_pb_button.et_pb_custom_button_icon.et_pb_more_button.et_pb_button_two {\r\n    position: absolute;\r\n    top: 10px;\r\n    right: 0px;\r\n}\r\n\r\nbody #page-container .et_pb_fullwidth_header_0 .et_pb_button_two.et_pb_buttons {\r\n    border-radius: 25px 0px 0px 25px;\r\n} */\r\n\r\n\r\n.col-txt span {\r\n    color: #9675f7;\r\n}\r\n\r\n.tab-left>ul.et_pb_tabs_controls{\r\n    margin-left: 120px;\r\n}\r\n\r\n.tab-left>ul.et_pb_tabs_controls>li>:active{\r\n    color: #9675f7;\r\n}\r\n.tab-left>ul.et_pb_tabs_controls>li.et_pb_tab_0>a:hover {\r\n    color: yellow;\r\n}\r\n.sec-over{\r\n    margin-top: -88px;\r\n    z-index: 30;\r\n}\r\nbody #main-footer {\r\n    padding-left: 280px;\r\n}\r\n\r\nbody #footer-bottom {\r\n    padding-left: 120px;\r\n}\r\n\r\n/********************************/\r\n/*** WOO AND TWENTY SEVENTEEN ***/\r\n/********************************/\r\n\r\n/*** BREADCRUMBS ***/\r\n.woocommerce .woocommerce-breadcrumb {\r\n	font-size: 16px;\r\n	font-weight: bold;\r\n	color: #222;\r\n}\r\n/*** BREADCRUMB LINKS ***/\r\n.woocommerce .woocommerce-breadcrumb a {\r\n	color: #00707a;\r\n}\r\n/*** CHANGE COLORS ON THE FILTER DROPDOWN ***/\r\nselect.orderby { \r\ndisplay: none;\r\n}\r\n/*** SINGLE GRID ITEM STYLING ***/\r\n.woocommerce ul.products li.product {\r\n	text-align: center; /* centers titles and prices */\r\n	background: #f5f5f5; /* changes background color */\r\n	padding: 1.5em 1em; /* adds space around entire product */\r\n	transition: all 0.2s;\r\n	-moz-transition: all 0.2s; \r\n	-webkit-transition: all 0.2s; \r\n}\r\n.woocommerce ul.products li.product:hover {\r\n	background: #fff; /* changes background color on hover */\r\n    box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1); /* adds shadow on hover */\r\n	-webkit-box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1); \r\n	-moz-box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1);\r\n}\r\n/*** CHANGE COLOR ON SINGLE GRID AND RELATED PRODUCTS (THIS IS WHERE YOU CAN CHANGE THE FONT SIZE TOO IF YOU WANT) ***/\r\nh2.woocommerce-loop-product__title,\r\n.product .related h2 {\r\n	color: #000; /* change color of product titles */\r\n}\r\n/*** ADD TO CART BUTTON ***/\r\n.woocommerce ul.products li.product .button {\r\n	display: inline-block;\r\n	box-shadow: none;\r\n	background: #333;\r\n	color: #fff;\r\n	font-size: 16px;\r\n	padding: 8px 12px;\r\n	margin-bottom: 0.5em;\r\n	border-radius: 4px; /* makes rounded edges */\r\n}\r\n/*** CENTER STAR RATING AND MAKE STARS BIGGER ***/\r\n.woocommerce ul.products li.product .star-rating {\r\n	font-size: 18px;\r\n	margin-left: auto;\r\n	margin-right: auto;\r\n}\r\n/*** CHANGE STAR COLOR FROM THEME COLOR ***/\r\n.woocommerce .star-rating span::before {\r\n	color: #ffa500;\r\n}\r\n/*** CHANGE PRICE SIZE ON GRID AND RELATED PRODUCTS ***/\r\n.woocommerce ul.products li.product .price, \r\n.woocommerce ul.products li.product .price del, \r\n.woocommerce-page ul.products li.product .price, \r\n.woocommerce-page ul.products li.product .price del {\r\n	font-size: 18px;\r\n}\r\n/*** CENTER SALE BADGE AND CHANGE COLORS ***/\r\n.woocommerce span.onsale, \r\n.woocommerce-page span.onsale {\r\n	background: #FFA500;\r\n	color: #fff;\r\n	letter-spacing: 2px;\r\n	left: 50%;\r\n	transform: translate(-50%, -50%);\r\n	-ms-transform: translate(-50%, -50%);\r\n}\r\n/*** GET RID OF BLACK LINE UNDER IMAGE ***/\r\n.woocommerce ul.products li.product img {\r\n	border: 3px solid #fff; /* adds border around image and is optional */\r\n	box-shadow: none;\r\n	text-decoration: none;\r\n}\r\na.woocommerce-LoopProduct-link, a.woocommerce-loop-product__link,\r\na.woocommerce-LoopProduct-link:hover, a.woocommerce-loop-product__link:hover,\r\na.woocommerce-LoopProduct-link:focus, a.woocommerce-loop-product__link:focus {\r\n	box-shadow: none;\r\n	outline: 0;\r\n}\r\n/*** REMOVE/CHANGE COLOR BEHIND PRICE ***/\r\n.woocommerce ul.products li.product span.price ins {\r\n	background: transparent; \r\n}', 'Divi-child', '', 'inherit', 'closed', 'closed', '', '24-revision-v1', '', '', '2020-02-28 17:56:15', '2020-02-28 17:56:15', '', 24, 'http://localhost/clicknbuy/24-revision-v1/', 0, 'revision', '', 0),
