et_pb_row][et_pb_row custom_margin=\"30px||\" _builder_version=\"3.22.7\" box_shadow_style=\"preset1\" box_shadow_vertical=\"7px\"][et_pb_column type=\"1_2\" _builder_version=\"3.22.7\"][et_pb_text _builder_version=\"3.22.7\" text_font=\"||||||||\" header_font=\"||||||||\" header_2_font=\"|700|||||||\" header_2_text_align=\"center\" header_2_font_size=\"35px\" custom_margin=\"70px||\" animation_style=\"fade\"]<h2>Price Gurantee</h2>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"3.22.7\"][et_pb_text _builder_version=\"3.22.7\" text_font=\"|600|||||||\" text_font_size=\"24px\" text_line_height=\"1.8em\" header_font=\"||||||||\" header_2_font=\"|600|||||||\" header_2_text_align=\"center\" header_2_font_size=\"25px\" animation_style=\"fade\"]<p>We constantly check our competitor\'s prices to ensure that we provide our customers with the best prices available in the market. This is the hallmark of our marketplace that we keep the customer at the heart of every decision that we take.</p>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row custom_margin=\"30px||\" _builder_version=\"3.22.7\" box_shadow_style=\"preset1\" box_shadow_vertical=\"7px\"][et_pb_column type=\"1_2\" _builder_version=\"3.22.7\"][et_pb_text _builder_version=\"3.22.7\" text_font=\"||||||||\" header_font=\"||||||||\" header_2_font=\"|700|||||||\" header_2_text_align=\"center\" header_2_font_size=\"35px\" custom_margin=\"60px||\" animation_style=\"fade\"]<h2>Return Policy</h2>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"3.22.7\"][et_pb_text _builder_version=\"3.22.7\" text_font=\"|600|||||||\" text_font_size=\"24px\" text_line_height=\"1.8em\" header_font=\"||||||||\" header_2_font=\"|700|||||||\" header_2_text_align=\"center\" header_2_font_size=\"35px\" animation_style=\"fade\"]<p>All products sold on Click n Buy are covered by our <em><b>100% Purchase Protection.</b></em><b><br />If the product is defective, damaged or if you receive an incorrect / incomplete product, then Click n Buy will always <em>replace</em>or<em>refund</em>the product given that you contact us within 7 days of delivery.</b></p>\n<p>Click n Buy also offers a <em><b>No Questions Asked</b></em>returns policy for selected products: If you are not perfectly satisfied, you can return your product for a refund or replacement within 7 days of delivery.</p>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row custom_margin=\"30px||\" _builder_version=\"3.22.7\" box_shadow_style=\"preset1\" box_shadow_vertical=\"7px\"][et_pb_column type=\"1_2\" _builder_version=\"3.22.7\"][et_pb_text _builder_version=\"3.22.7\" text_font=\"||||||||\" header_font=\"||||||||\" header_2_font=\"|700|||||||\" header_2_text_align=\"center\" header_2_font_size=\"35px\" custom_margin=\"60px||\" custom_padding=\"100px||\" animation_style=\"fade\"]<h2>Privacy Policy</h2>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"3.22.7\"][et_pb_text _builder_version=\"3.22.7\" text_font=\"|600|||||||\" text_font_size=\"24px\" text_line_height=\"2.2em\" header_font=\"||||||||\" header_2_font=\"|700|||||||\" header_2_text_align=\"center\" header_2_font_size=\"35px\" animation_style=\"fade\"]<ul>\n<li>Click N Buy is concerned with your privacy and ensures maximum safety of it. We respect our customers data, so please take your time to read our privacy policy to know how Click N Buy uses your information and protects it.</li>\n<li>Click N Buy understands your privacy needs and does not sell, share or trade any customer information with third parties. All personal data collected will be used exclusively and internally among Click N Buy group only. In-case your information including your name and address is forwarded, it is only with intentions that your order gets delivered at your doorstep.</li>\n<li>When you place an order at Click N Buy your personal information such as your viewing history, order history and such activities are automatically used for marketing and promotional purposes occasionally. You do have the right to choose not to receive any marketing and promotional information by simply clicking the unsubscribe button that we provide you with.</li>\n</ul>[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]', 'About Us', '', 'inherit', 'closed', 'closed', '', '464-revision-v1', '', '', '2020-03-06 16:33:34', '2020-03-06 16:33:34', '', 464, 'http://localhost/clicknbuy/464-revision-v1/', 0, 'revision', '', 0);
